import logo from "./images/by.png";

import './App.css';
import Anasayfa from "./components/Anasayfa";
import {Route, Routes, useParams} from 'react-router-dom';
import {Alert, Container, Nav, Navbar, NavDropdown} from "react-bootstrap";
import React from "react";

function App() {
    return (
        <div className="App">

            <Navbar expand="lg" className="bg-body-tertiary">
                <Container>
                    <Navbar.Brand href="#home">
                        <img className="logo" src={logo} alt=""/>
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link  href="/anasayfa">Ana Sayfa</Nav.Link>
                            <Nav.Link href="/">HakkÄ±mda</Nav.Link>
                            <NavDropdown title="Oyun" id="basic-nav-dropdown">
                                <NavDropdown.Item href="/">Oyun 1</NavDropdown.Item>
                                <NavDropdown.Item href="/">Oyun 2</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">
                                    Separated link
                                </NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
            <div className="container">
                <div className="row">
                    <div className="col-12">

                       <Routes>
                           <Route path="/anasayfa" element={<Anasayfa/>}/>
                       </Routes>


                    </div>
                </div>
            </div>

        </div>
    );
}

export default App;

function Child() {
    let {id}=useParams();
    return(
        <div>
            <h6>ID: {id}</h6>
        </div>
    )
}
